class PageRankGraph():

    def __init__(self, labels, v, MATRIX):
        """

        :param labels:, 节点的标签list
        :param v:       初始向量list
        :param MATRIX:  矩阵
        public final String[] labels;
        //初始向量
        public double[] V;
        //转移矩阵
        public final double[][] MATRIX;
        """
        # /**
        #  * 节点的标签
        #  */
        self.labels = labels
        # // 初始向量
        self.V = v
         # // 转移矩阵
        self.MATRIX = MATRIX


    # /**
    #   * 计算PageRank
    #   *
    #   * @param iterateCount: 迭代次数
    #   * @param taxRatio      抽税的百分比，一般取值为0.15
    #   */
    def iterateCalculation(self, iterateCount, taxRatio):
        # double[] copyV = new double[V.length];
        Vlen = len(self.V)
        copyV=[0]*Vlen
        iterators = 0
        for iterators in range(iterateCount):
            for i in range(Vlen):
                copyV[i]=0
                for j in range(Vlen):
                    copyV[i] += self.MATRIX[i][j] * self.V[j]

                copyV[i] = (1 - taxRatio) * copyV[i] + taxRatio / Vlen

            copyV , self.V = self.V, copyV
        pass
    pass

    def quickSort(self):
        # # http://blog.csdn.net/chichoxian/article/details/53160301
        a = self.V
        b = self.labels
        import numpy as np
        c = np.array([np.array(a).T, np.array(b).T]).T
        # print(c)

        res = sorted(c, key=lambda x: float(x[0]), reverse=True)
        t1 = np.array(res).T
        self.lableSortRes = t1[1]
        self.VSortRes = t1[0]


    # // shuffle the array a[] 打乱顺序
    def _shuffle(self):
        NLen = len(self.V)-1
        for i in range(NLen):
            r = i +  np.random.random_integers(NLen - i)
            self.V[i], self.V[r] = self.V[r], self.V[i]
            self.labels[i], self.labels[r] =self.labels[r], self.labels[i]
    def _quicksort(self,firstIndex, lastIndex):
        if firstIndex < lastIndex:
            divIndex = self._partition( firstIndex, lastIndex)
            # divIndex = self._partitionJiangXu( firstIndex, lastIndex)

            self._quicksort( firstIndex, divIndex)
            self._quicksort( divIndex + 1, lastIndex)
        else:
            return
    def _partition( self,firstIndex, lastIndex):
        """改变位置，"""
        i = firstIndex
        for j in range(firstIndex, lastIndex):
            # if 条件 《为升序  〉为降序
            if self.V[j] >= self.V[lastIndex]:
                i = i + 1
                self.V[i], self.V[j] = self.V[j], self.V[i]
                self.labels[i], self.labels[j] = self.labels[j], self.labels[i]
        self.V[i], self.V[lastIndex] = self.V[lastIndex], self.V[i]
        self.labels[i], self.labels[lastIndex] = self.labels[lastIndex], self.labels[i]

        # print("====")
        # print(self.V)
        # print(self.labels)
        return i


